class Category {  Category({      this.id,       this.nameAr,       this.nameEn,});  Category.fromJson(dynamic json) {    id = json['id'];    nameAr = json['name_ar'];    nameEn = json['name_en'];  }  int? id;  String? nameAr;  String? nameEn;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name_ar'] = nameAr;    map['name_en'] = nameEn;    return map;  }}